import React from 'react';
import { ClassNames } from 'helpers/ClassNames/ClassNames';
import cls from './StudentContent.module.css';
import { Button } from 'UI/Button/Button';
import { AddImageIcon } from 'UI/AddImageIcon/AddImageIcon'
import { ProfileForm } from '../ProfileForm/ProfileForm';
import { CustomLink } from 'UI/CustomLink/CustomLink';
import { FormInputRow } from 'components/FormInputRow/FormInputRow';


export const StudentContent = (props) => {
    const { className } = props;

    return (
        <div className={ClassNames(cls.studentContent, {}, [className])}>
            <div className={cls.ProfilePage}>
                <div className={cls.row}>
                    <Button className={cls.button}><AddImageIcon className={cls.icon} /></Button>
                    <FormInputRow 
                        theme={'border'} 
                        id={'firstname'} 
                        name={'firstname'} 
                        placeholder='Иван' 
                        label='Имя:' 
                        className={cls.row} 
                    />
                    <FormInputRow 
                        theme={'border'} 
                        id={'secondname'} 
                        name={'secondname'} 
                        placeholder='Иванов' 
                        label='Фамилия:' 
                        className={cls.row} 
                    />
                    <p className={cls.resetPassword}>
                        Забыли пароль? <br />
                        <CustomLink className={cls.link} to="reset">Нажмите, чтобы восстановить</CustomLink>
                    </p>
                </div>
                <div className={cls.row}></div>
            </div>
        </div>
 );
}
